import React from "react";
import "./AgentFilter.css";

import { Line } from 'react-chartjs-2';

export default function LineChart(){
    <Line
    datasetIdKey='id'
    data={{
        labels: ['Jun', 'Jul', 'Aug'],
        datasets: [
        {
            id: 1,
            label: '',
            data: [5, 6, 7],
        },
        {
            id: 2,
            label: '',
            data: [3, 2, 1],
        },
        ],
    }}
    />
}
